import styled from 'styled-components';
const LeftArea = () => {
    const MainSection = styled.section`
        margin: 0px;
        padding:0px;
`; //ContentWarp 메인 css

    const WarpSection = styled.div`
        margin: 0 16vw;
    `;
    const LeftSection = styled.main`
        display: flex;
        justify-content: space-between;

    `;
    return(
        <MainSection>
            <WarpSection>

            </WarpSection>
        </MainSection>
    )
}
export default LeftArea;
